CREATE PROCEDURE dbo.proc_transform_175
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_175
    SET payload = LEFT(payload, 1000) + N'|V4-175|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_175;
END
